    false,nt"url": null,nt"notes": "Estimates at Lower Russian Lake weir revealed
    the out-migration of sockeye salmon, Oncorhynchus nerka, smelts was 1,018,527.  The
    peak of the migration (75% of the total) occurred during the 15-day period May 22-June
    5.  Early run escapement was 19,700 sockeye salmon.  This escapement is one of the
